import Aff from "./Affiche";
export default function Home(props){
    return(
        <div className="row">
            {
                props.movie.map((mov,i)=>{
                    return (
                    <div className="container-fluid movie-app" >
                    <div className="row">
                    <div className="d-flex justify-content-start m-3">
                        <Aff movie={mov} key={i} />
                        </div>
                    </div>
                    </div>
                    )
                })
            }
        </div>
    )
}
